import React from 'react'
import { FormControl, FormLabel, Input, FormHelperText, Center, Box, Container } from '@chakra-ui/react'

export default function Login() {
    return (
        <>
            <Container maxWidth={'sm'} marginTop={50}>
                    {/* <Center width={300}> */}
                        <FormControl>
                            <FormLabel>Email address</FormLabel>
                            <Input type='email' />
                            <FormHelperText>We'll never share your email.</FormHelperText>
                        </FormControl>
                    {/* </Center> */}
            </Container>
        </>
    )
}
